import './File.css'
import { Link } from 'react-router-dom'

export const File = ({ data, onClick }) => {
	return (
		<>File</>
	)
}

export const Dir = ({ data }) => {
	return (
		<>Dir</>
	)
}

export const Preview = ({ data }) => {
	return (
		<>File Preview</>
	)
}
